<!DOCTYPE html>
<html>
	<head>
		<title></title>
		<meta name="viewport"content="width=device-width,initial-scale=1">
		<style>
		</style>
	</head>
	<body>
		<button onclick="document.body.innerHTML+='<br>'+(()=>{let r='';for(let i=0;i<20;i++){r+=seq.next().value}return r})()">generate</button>
		<script>
var{random}=Math,blacklist=[];
function*randomVariable(){
	for(;;){
		let r=""
		let verify=(n)=>{
			let code=String.fromCharCode(n|0)
			if((()=>{try{eval(`var ${code}`);return true}catch(e){return ![]}})()){
				r=code
			}else{
				verify(random()*2**17-2**16)
			}
		}
		verify(random()*2**17-2**16)
		yield r
	}
}
const seq=randomVariable()
		</script>
	</body>
</html>
